import React, { Component } from "react";

class UploadNavButtons extends Component {
  state = {};
  render() {
    return (
      <div id="uploadManualButtons">
        <span>Back</span>
        <span>Next</span>
      </div>
    );
  }
}

export default UploadNavButtons;
